import '../App.css';

function Navbar() {
    return (
        <div className="navbar">
            <div className='navlinks'>
            <Routes >
                    <Route exact path="/contact" element={<Contact />} />
                    <Route exact path="/projects" element={<Projects />} />
                    <Route exact path="/" element={<Home />} />
                </Routes >
            </div>
        </div>
    );
}

export default Navbar;
